import React, { Component } from 'react';
import NavWithDropDown from '../NavBar';
import Form from 'react-bootstrap/Form';
import './UpdateProfile.css';

class UpdationForm extends Component {
    constructor(props){
        super(props);
        this.state = {
            message : '',
            color : ''
        }
        this.updateProfile = this.updateProfile.bind(this);
        this.sendRequest = this.sendRequest.bind(this);
    }

    updateProfile(event) {
        event.preventDefault();
        event.stopPropagation();

        var name = document.getElementById("formName").value;
        var password = document.getElementById("formPassword").value;
        var confirmPassword = document.getElementById("formConfirmPassword").value;
        var phoneNumber = document.getElementById("formNumber").value;
        this.sendRequest(name,password,confirmPassword,phoneNumber);
    }

    sendRequest(name,password,confirmPassword,phoneNumber){

        var jsonBody = {
            "name":name,
            "password": password,
            "phoneNumber":phoneNumber
        }

        var requestOptions = {
            method : 'POST',
            mode : 'cors',
            headers: {'Content-Type':'application/json'},
            body : JSON.stringify(jsonBody),
            referrerPolicy:"no-referrer",
        }

        this.setState(() => {
            fetch('http://localhost:8084/stockexchange/createExchange',requestOptions)
            .then(response => {
                if(response.status  === 200) {
                    this.setState({
                        message : "New Exchange created ",
                        color : "green"
                    })
                    return response.json();
                }
                else {
                    this.setState({
                        message:"Error creating Exchange!",
                        color:"red"
                    })
                }
                return null;
            }).then(data => {
                if(data != null){
                    setTimeout(() => {
                        this.props.history.push("/adminHome");
                    },2000);     
                }
            })
        })      
    }

    render(){
        
        var messagestyle = {
            fontSize : '16px',
            color : this.state.color
        }

        return(
            <Form className="justify-content-center" onSubmit={this.createExchange}>
                        <Form.Group controlId="formExchangeName">
                        <Form.Label>Exchange Name</Form.Label>
                            <Form.Control type="text" placeholder="Enter Exchange name"  required/>
                        </Form.Group>
                        <Form.Group controlId="formBrief">
                            <Form.Label>Brief</Form.Label>
                            <Form.Control  type="text" placeholder="Enter Brief details" required />
                        </Form.Group>

                        <Form.Group controlId="formNumber">
                            <Form.Label>Contact Number</Form.Label>
                            <Form.Control type="text" placeholder="Enter Contact Number" required />
                        </Form.Group>

                        <Form.Group controlId="formRemarks">
                            <Form.Label>Remarks</Form.Label>
                            <Form.Control type="text" placeholder="Enter Remarks" required />
                        </Form.Group>


                        <br></br>
                        <br></br>

                        <Row>
                            <Col>
                                <Button variant="primary" type="submit">
                                    Create Exchange
                                </Button>
                            </Col>
                            
                            <Col>
                                <span style={messagestyle}>{this.state.message}</span>
                            </Col>
                        </Row>
                     
                    </Form>
        );
    }
}
class UpdateProfile extends Component {
    render(){
        return(
            <React.Fragment>
                <NavWithDropDown />
                <br></br>
                <br></br>
                <br></br>
                <UpdationForm />
            </React.Fragment>
            
        );
    }
}

export default UpdateProfile;
